import {menu} from './Type'
import { Switch } from 'react-router-dom'


const inittialState = {
    Menu:"Services"
}

const Reducer = (state = inittialState, action )=>{
    switch(action.type){
        case type:
            return {
                Menu:action.data     
            }
        default : return state 
    }
}

export default Reducer
